        return (
            <div>
                <br/>
                <br/>
                <br/>
                You have clicked many times!

            {/* <button onClick={() => this.changeMessage()}>Change</button> */}
            {/* <button onClick={() => this.changeMessageBack()}>Change back</button> */}
            </div>

        ) 
    }
}

export default Counter
